import React from "react";
import "../../styles/start.css";
import trainer from "../../assets/img/trainer.png";

const Start = () => {
  return (
    <section>
      <div className="container">
        <div className="start__wrapper">
          <div className="start__img">
            <img src={trainer} />
          </div>
        </div>
      </div>
    </section>
  );
};

export default Start;
